import React from 'react';
import Navbar from './Navbar';
import Footer from './Footer';

const Card = (props) => {
  return (
    <div className="card">
      <img className="card-img-top" src={props.image} alt="Card image cap" />
      <div className="card-body">
        <h5 className="card-title">{props.title}</h5>
        <p className="card-text">{props.text}</p>
        <button className="btn btn-primary">Cumpara</button>
      </div>
    </div>
  );
};

const CardDeck = () => {
  const cards = [
    {
      id: 1,
      title: 'Program de slabire',
      text: 'Acest program te va ajuta să slăbești în mod sănătos și eficient.',
      image: 'https://example.com/image1.jpg',
    },
    {
      id: 2,
      title: 'Program de definire musculara',
      text: 'Acest program te va ajuta să-ți definești mușchii și să obții un corp tonifiat.',
      image: 'https://example.com/image2.jpg',
    },
    // etc.
  ];

  return (
    <div>
      <Navbar />
      <div className="container">
        <div className="row">
          {cards.map((card) => (
            <div key={card.id} className="col-md-4">
              <Card {...card} />
            </div>
          ))}
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default CardDeck;
